        require(!checkSeller(_sellerID), "Seller is already in Seller List");
        sellerList.push(_sellerID);
        sellerNames[_sellerID] = _name;
    }

    function getSellers() public view onlyOwner returns (string[] memory, address[] memory) {
        string[] memory names = new string[](sellerList.length);
        for (uint i = 0; i < sellerList.length; i++){
            names[i] = sellerNames[sellerList[i]];
        }
        return (names, sellerList);
